But practice makes progress.

When I started blogging, I sucked. And it wasn't fun.

When I started lifting weights, I sucked. And it felt like I'd never make progress.

When I baked my first cake, it sucked. And it felt like a waste of time and resources.

But now, after loooorttttsss of practice, I not only LOVE all of these things, I'm actually pretty good at them!

Notice I didn't say "perfect". I'm definitely not that. At anything.

But a gymnast friend of mine (@calipop22 ğŸ˜˜) shared with me a while back something her coach always told her when they were training for competitions, and it really stuck with me: "Practice Makes Progress".

Not "practice makes perfect", because honestly, it doesn't.

But with enough practice, you really can get good at almost anything. Don't you think?

If you're interested in blogging or working from home, reach out! I can help point you in the right direction. I also have free resources via the link in my bio.

